function SignIn(){let n=getCookie("token");n!=""&typeof n!="undefined"&&deleteCookie("token");let t={Email:$("#email").val(),Password:$("#password").val()};$.ajax({url:"/api/v1/auth/login",type:"POST",contentType:"application/json",data:JSON.stringify(t),success:function(n){RedirectToAccount(n)},error:function(n,t,i){alert(n+"\n"+t+"\n"+i)}})}function RedirectToAccount(n){var t="Bearer "+n;$.ajax({url:"/Account/Index/",type:"GET",contentType:"application/json",beforeSend:function(n){n.setRequestHeader("Authorization",t)},success:function(){document.cookie="token="+n+";  path=/; ";window.location.href="/Account/Index/"},error:function(){alert("Error")}})}function Registration(){let n={Email:$("#emailRegistration").val(),Password:$("#passwordRegistration").val()};$.ajax({url:"/api/v1/auth/registration",type:"POST",contentType:"application/json",data:JSON.stringify(n),success:function(){RedirectToAccount()},error:function(n,t,i){alert(n+"\n"+t+"\n"+i)}})}function deleteCookie(n){setCookie(n,"",{"max-age":-1})}function getCookie(n){let t=document.cookie.match(new RegExp("(?:^|; )"+n.replace(/([\.$?*|{}\(\)\[\]\\\/\+^])/g,"\\$1")+"=([^;]*)"));return t?decodeURIComponent(t[1]):undefined}function readCookie(n){for(var t,r=n+"=",u=document.cookie.split(";"),i=0;i<u.length;i++){for(t=u[i];t.charAt(0)==" ";)t=t.substring(1,t.length);if(t.indexOf(r)==0)return t.substring(r.length,t.length)}return null}let token=getCookie("token");token!=""&typeof token!="undefined"&&(window.location.href="/Account/Index/");$(document).ready(function(){$("#signIn").click(function(n){n.preventDefault();SignIn()})});$(document).ready(function(){$("#registration").click(function(n){n.preventDefault();Registration()})});